import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
// import angelImage from '../assets/angel.png'; // Eğer melek resmi assets klasöründeyse bu şekilde import edin

const symbols = ['Σ', 'π', '∞', '∆', 'Ω', '√'];

function IntroAnimation() {
  const [showSymbols, setShowSymbols] = useState(true);
  // Statik URL yolunu kullanıyoruz, dosyayı public klasörüne koymalısınız
  // const [audio] = useState(new Audio('/assets/mystical-background.mp3'));

  useEffect(() => {
    const timer = setTimeout(() => {
      setShowSymbols(false);
    }, 6000); // Animasyon süresini biraz uzattım

    return () => clearTimeout(timer);
  }, []);

  // Müzik için önce Audio öğesinin yüklenip yüklenmediğini kontrol edelim
  // useEffect(() => {
  //   // Müzik ayarları
  //   if (audio) {
  //     audio.volume = 0.2; // Ses seviyesi
  //     audio.loop = true; // Sürekli çalma
      
  //     // Kullanıcı etkileşimi sonrası müziği başlat
  //     const startMusic = () => {
  //       audio.play().catch(error => console.log('Müzik başlatılamadı:', error));
  //       document.removeEventListener('click', startMusic);
  //     };

  //     document.addEventListener('click', startMusic);

  //     return () => {
  //       audio.pause();
  //       audio.currentTime = 0;
  //       document.removeEventListener('click', startMusic);
  //     };
  //   }
  // }, [audio]);

  return (
    <AnimatePresence>
      {showSymbols && (
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          exit={{ opacity: 0 }}
          className="fixed inset-0 flex items-center justify-center bg-midnight-default z-50"
        >
          <div className="relative w-96 h-96 flex items-center justify-center">
            {/* Kanatlar */}
            <motion.div
              initial={{ opacity: 0, scale: 0.5 }}
              animate={{ opacity: 1, scale: 1, rotateY: [0, 10, 0] }}
              transition={{ 
                duration: 4, 
                ease: "easeInOut",
                times: [0, 0.5, 1],
                repeat: Infinity,
              }}
              className="absolute"
            >
              <div className="flex">
                {/* Sol Kanat */}
                <motion.div
                  initial={{ rotate: -20 }}
                  animate={{ rotate: [-20, -10, -20] }}
                  transition={{ 
                    duration: 3, 
                    ease: "easeInOut",
                    times: [0, 0.5, 1],
                    repeat: Infinity,
                  }}
                  className="w-32 h-64 bg-gradient-to-br from-gold-light/90 to-gold-default/50 rounded-full blur-sm transform -rotate-12 origin-bottom"
                  style={{ clipPath: "polygon(0 50%, 100% 0, 100% 100%, 0 100%)" }}
                />
                
                {/* Sağ Kanat */}
                <motion.div
                  initial={{ rotate: 20 }}
                  animate={{ rotate: [20, 10, 20] }}
                  transition={{ 
                    duration: 3, 
                    ease: "easeInOut",
                    times: [0, 0.5, 1],
                    repeat: Infinity,
                  }}
                  className="w-32 h-64 bg-gradient-to-bl from-gold-light/90 to-gold-default/50 rounded-full blur-sm transform rotate-12 origin-bottom"
                  style={{ clipPath: "polygon(0 0, 100% 50%, 100% 100%, 0 100%)" }}
                />
              </div>
            </motion.div>

            {/* Merkez sembol */}
            <motion.div
              initial={{ scale: 0, rotate: 0, opacity: 0 }}
              animate={{ scale: 1, rotate: 360, opacity: 1 }}
              transition={{ duration: 2, ease: "easeOut", delay: 1 }}
              className="absolute"
            >
              <span className="text-6xl font-cinzel text-gold-default">∞</span>
            </motion.div>

            {/* Dönen semboller */}
            {symbols.map((symbol, index) => (
              <motion.div
                key={symbol}
                initial={{ scale: 0, rotate: 0, opacity: 0 }}
                animate={{ 
                  scale: 1,
                  rotate: 360,
                  opacity: 1,
                  x: Math.cos(index * (2 * Math.PI / symbols.length)) * 100,
                  y: Math.sin(index * (2 * Math.PI / symbols.length)) * 100
                }}
                transition={{ 
                  duration: 2,
                  delay: 1 + (index * 0.2),
                  ease: "easeOut"
                }}
                className="absolute"
              >
                <span className="text-4xl font-cinzel text-gold-light">{symbol}</span>
              </motion.div>
            ))}

            {/* Radyal gradient efekti */}
            <motion.div
              initial={{ opacity: 0 }}
              animate={{ opacity: [0, 0.7, 0] }}
              transition={{ 
                duration: 4,
                times: [0, 0.5, 1],
                repeat: Infinity,
                ease: "easeInOut"
              }}
              className="absolute inset-0 bg-gradient-to-r from-gold-default/20 via-transparent to-gold-default/20 rounded-full blur-xl"
            />

            {/* Işık ışınları */}
            <motion.div
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ duration: 2, delay: 0.5 }}
              className="absolute w-full h-full"
            >
              {[...Array(12)].map((_, i) => (
                <motion.div
                  key={i}
                  initial={{ opacity: 0, scale: 0.8 }}
                  animate={{ 
                    opacity: [0.3, 0.7, 0.3],
                    scale: [0.8, 1.2, 0.8]
                  }}
                  transition={{ 
                    duration: 3,
                    delay: i * 0.2,
                    repeat: Infinity,
                    ease: "easeInOut"
                  }}
                  className="absolute top-1/2 left-1/2 w-1 h-20 bg-gold-light/30 blur-sm"
                  style={{ 
                    transformOrigin: "center bottom",
                    transform: `translate(-50%, -100%) rotate(${i * 30}deg)` 
                  }}
                />
              ))}
            </motion.div>

            {/* Başlık ve Hoşgeldiniz mesajı */}
            <motion.div 
              className="absolute -bottom-28 left-1/2 transform -translate-x-1/2 flex flex-col items-center"
            >
              <motion.h1
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 1.5, duration: 1 }}
                className="text-3xl font-cinzel text-gold-default whitespace-nowrap"
              >
                Nomen Est Omen
              </motion.h1>
              
              <motion.p
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ delay: 2, duration: 1 }}
                className="mt-4 text-xl font-cinzel text-gold-light"
              >
                Hoşgeldiniz
              </motion.p>
            </motion.div>
          </div>
        </motion.div>
      )}
    </AnimatePresence>
  );
}

export default IntroAnimation;
